import { Component, OnInit } from '@angular/core';
import { ActionSheetController, AlertController, MenuController} from '@ionic/angular';
import { Observable, Subscription } from 'rxjs';
import { Pieza } from 'src/app/interfaces/pieza';
import { Producto } from 'src/app/interfaces/producto';
import { Sesion } from 'src/app/interfaces/sesion';
import { BackendService } from 'src/app/servicios/backend.service';
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import { idventa } from 'src/app/interfaces/idventa';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-venta',
  templateUrl: './venta.page.html',
  styleUrls: ['./venta.page.scss'],
})
export class VentaPage implements OnInit {

  productos: Observable<Producto[]>;
  id:Observable<idventa[]>;
  idventa=0;
  listaP: Array<Pieza>=[]
  suscription: Subscription;
  total:number = 0;
  sesion: Observable<Sesion[]>
  piezas;
  pdfObject;

  nombre;
  apellidos;
  telefono;
  email;
  domicilio;
  tipo;
  idusuario;
  descripcion = '';
  

  constructor(private actionSheetController: ActionSheetController, private menuCtrl: MenuController, private backendService: BackendService, public alertController: AlertController) { }  

  ngOnInit() {
    this.productos = this.backendService.getProductos();
    this.productos.subscribe(p => {
      this.piezas = p;
      console.log(p)
    })

    let date: Date = new Date();
    console.log("Date = " + date);
    console.log(date.getMonth())
    console.log(date.getDay())

    this.suscription = this.backendService.refresh$.subscribe(() => {
      this.productos = this.backendService.getProductos();
    })
    this.sesion = this.backendService.getSesion();
    this.sesion.subscribe(sesion => {
      console.log(sesion[0]);
      this.idusuario = sesion[0].idusuario;
      this.nombre = sesion[0].nombre;
      this.apellidos = sesion[0].apellidos;
      this.telefono = sesion[0].telefono;
      this.email = sesion[0].email;
      this.domicilio = sesion[0].domicilio;
      this.tipo = sesion[0].tipo;

    })
    console.log('ngOnInit')
    this.suscription = this.backendService.refresh$.subscribe(() => {
      this.sesion = this.backendService.getSesion();
    })
  }

  ionViewWillEnter() {
    this.menuCtrl.enable(true);
  }

  agregar(nombre, precio){
    this.total = 0;
    this.descripcion = ''
    this.listaP.push({"nombre":nombre,"precio": precio})
    console.log(this.listaP[0].nombre);
    console.log(this.listaP);
    for(let i = 0; i < this.listaP.length; i++){
      this.total += this.listaP[i].precio;
      this.descripcion = this.descripcion + this.listaP[i].nombre+':   $'+this.listaP[i].precio+'\n'
    }
    console.log(this.total)
    console.log(this.descripcion)
  }

  async menuP() {
    const actionSheet = await this.actionSheetController.create({
      header: 'Productos',
      cssClass: 'my-custom-class',
      buttons: [{
        text: this.piezas[4].nombre,
        handler: () => {
          this.peso(this.piezas[4].nombre, this.piezas[4].precio, 'Introduzca la cantitad en unidades')
        }
      }, {
        text: this.piezas[0].nombre,
        handler: () => {
          this.peso('KG '+this.piezas[0].nombre, this.piezas[0].precio, 'Introduzca la cantitad en Kg')
        }
      }, {
        text: this.piezas[1].nombre,
        handler: () => {
          this.peso('KG '+this.piezas[1].nombre, this.piezas[1].precio, 'Introduzca la cantitad en Kg')
        }
      }, {
        text: this.piezas[2].nombre,
        handler: () => {
          this.peso('KG '+this.piezas[2].nombre, this.piezas[2].precio, 'Introduzca la cantitad en Kg')
        }
      }, {
        text: this.piezas[3].nombre,
        handler: () => {
          this.peso('KG '+this.piezas[3].nombre, this.piezas[3].precio, 'Introduzca la cantitad en Kg')
        }
      }, {
        text: 'Cancelar',
        icon: 'close',
        role: 'cancel',
        handler: () => {
          console.log('Cancel clicked');
        }
      }]
    });
    await actionSheet.present();
  }

  async peso(pnombre, precio, mensaje) {
    const alert = await this.alertController.create({
      cssClass: 'my-custom-class',
      header: pnombre,
      subHeader: mensaje,
      inputs: [
        {
          name: 'kg',
          type: 'number',
          min: 0.1
        },
      ],
      buttons: [
        {
          text: 'Cancelar',
          role: 'cancel',
          cssClass: 'secondary',
          handler: () => {
            console.log('Confirm Cancel');
          }
        }, {
          text: 'Ok',
          handler: ( data ) => {
            this.agregar(data.kg+' '+pnombre, (Number(data.kg)*precio)),
            console.log('Confirm Ok ',(Number(data.kg)*precio));
          }
        }
      ]
    });

    await alert.present();
  }

  async cancelar() {
    const alert = await this.alertController.create({
      header: 'Eliminar venta',
      subHeader: 'Â¿Estas seguro de eliminar la venta?',
      buttons: [
        {
          text: 'Cancelar',
          role: 'cancel',
          cssClass: 'secondary',
          handler: (blah) => {
            console.log('Confirm Cancel: blah');
          }
        }, {
          text: 'Eliminar',
          handler: () => {
            this.listaP = [];
            this.total = 0;
          }
        }
      ]
    });

    await alert.present();
  }

  async venta() {
    const alert = await this.alertController.create({
      header: 'Realizar venta',
      subHeader: 'Monto a pagar: '+this.total,
      inputs: [
        {
          name: 'monto',
          type: 'number',
          placeholder: 'Pago del cliente',
          min: 0.1
        },
      ],
      buttons: [
        {
          text: 'Cancelar',
          role: 'cancel',
          cssClass: 'secondary',
          handler: (blah) => {
            console.log('Confirm Cancel: blah');
          }
        }, {
          text: 'Continuar',
          handler: (data) => {
            if(this.total <= data.monto){
              this.cambio((data.monto-this.total),data.monto);
            }else{
              this.rechazo();
            }
          }
        }
      ]
    });

    await alert.present();
  }

  async cambio(t,m) {
    const alert = await this.alertController.create({
      header: 'Cambio: $'+t,
      buttons: [
        {
          text: 'Continuar',
          handler: () => {
            this.crearVenta();
            this.ticket(t,m)
            
            
          }
        }
      ]
    });

    await alert.present();
  }

  async rechazo() {
    const alert = await this.alertController.create({
      header: 'El monto pago es menor al total',
      buttons: [
        {
          text: 'Continuar',
          role: 'cancel',
          handler: () => {
          }
        }
      ]
    });

    await alert.present();
  }

  crearVenta(){
    let date = new Date();
    date.setDate(13);  
    date.setMonth(13);  
    date.setFullYear(2013);  
    this.listaP = [];

    this.backendService.crearVenta({
      "idusuario": this.idusuario,
      "descripcion": this.descripcion,
      "montoventa": this.total,
      "fecha": date,
      "hora": ""+date.getHours()+":"+date.getMinutes()+":"+date.getSeconds()
    })
  }

  ticket(cambio, monto){
    this.idventa = this.idventa +1;
    let date = new Date();
    let docDefinition = {
      content: [
        {
          stack: [
            {
              image: 'data:image/png;base64,',
              width: 100
            },
            {text: 'POLLOS GRIS ', fontSize: 40, bold: true},
            {text: 'Platino #362, Col. Salinas de Gortari.', fontSize: 15, bold: true},
            {text: 'Zamora, MichoacÃ¡n', fontSize: 15, bold: true},
            {text: 'Tel: 5106023', fontSize: 15, bold: true},
            {text: 'Muchas gracias por su compra', fontSize: 15},
            {text: '\n TICKET DE VENTA ', fontSize: 20, bold: true},
            
            {text: '\n \n  No. de venta: '+this.idventa, fontSize: 15, bold: true},
            {text: 'Fue atendido por '+this.nombre+' '+this.apellidos, fontSize: 15, bold: true},
            {text: 'No. Usuario: '+this.idusuario, fontSize: 15, bold: true},
            {text: 'Fecha: '+(date.getDay()+13)+'/'+(date.getMonth()+1)+'/'+date.getFullYear()+'         Hora: '+date.getHours()+':'+date.getMinutes()+':'+date.getSeconds()+'\n', fontSize: 15, bold: true},
            {text: '\n ', fontSize: 15, bold: true},
            {
              style: 'tableExample',
              
              table: {
                widths: [500],
                body: [
                  [{text: '\n Productos comprados \n ', fontSize: 15}],
                  
                  [{text: '\n '+this.descripcion+'\n', fontSize: 15}],
                  [{text: '\n Total: $'+this.total+'\n ', fontSize: 15}]
                ]
              }
            },
            {text: '\n \n Pago con: $'+monto, fontSize: 15},
            {text: '\n Cambio: $'+cambio, fontSize: 15},
          ],
          fontzise: 40,
          margin: [0, 20, 0, 0],
          alignment: 'center'
        }
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          alignment: 'center'
        }
      }
    };

    this.pdfObject = pdfMake.createPdf(docDefinition)
    this.pdfObject.download()
  }

}
